const Card = (props) => {
  const diets = Array.isArray(props.diet) ? props.diet : [];

  return (
    <div className={styles.card}>
      <NavLink to={`/detail/`}>
        <h1>{props.name}</h1>
        <img src={props.image} alt={props.name} />
      </NavLink>
      <h2>DIET:</h2>
      <ul>
        {diets.map((diet, index) => (
          <li key={index}>{diet}</li>
        ))}
      </ul>
    </div>
  );
};


